import React, { Component } from 'react'
import './index.css'

export default class Header extends Component {
    handleKeyUp = (event) => {
        const { keyCode, target } = event  //结构附值
        if (keyCode !== 13) return
        console.log(target.value)  //ketCode 键盘按键编号
        console.log(target)
        this.props.addTodos(target.value)
    }
    render() {
        return (
            <div className='todo-header'>
                <input onKeyUp={this.handleKeyUp} type='text' placeholder='Input your task name, enter tab to comfirm'></input>
            </div>
        )
    }
}
